import React, {useEffect, useState} from 'react';
// import {Link} from 'react-router-dom';

function UserPost() {
    useEffect( () => {
        fetchItems();
    }, []);

    const [items, setItems] = useState([]);

    const fetchItems = async () => {
        const data = await fetch('/api/user/postanduser',{
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
        });
        const items = await data.json();
        setItems(items.data);
    };

    return(
        <section>
            {            
            items.map(item => (
                <div key={item.id}  className="container-fluid p-3 w-50">
                    <div className="card-deck">
                        <div className="card">
                            <div className="card-body p-1">
                                <h6 className="card-title">{item.vName}</h6>
                                <p className="card-text"><i>{item.vCity}</i></p>
                                <p className="card-text"><i>{item.vHobbies}</i></p>
                            </div>
                        </div>
                    </div>
                </div>
            ))
            }
        </section>
    );
}

export default UserPost;
